import React from 'react'
import { useQuery } from '@apollo/client';
// import { videoPlaying } from '../../../../../../graphql-client/Queries';
export default function DocumentVideoPlaying(props) {
    // lấy thông tin video
    const[videoPlaying,{loading,error,data}]= useQuery(getDocumentVideo);
if (loading) return <p>Loading ...</p>;
if (error) return <p>error</p>
    return (
        <div className="tab-pane" id="document" role="tabpanel" aria-labelledby="document-tab">
                        {data.video.document}
                        <p>this is document</p>
                        {/* {props.doc} */}
                        
                    
        </div>

    )
}
